import React, { Component } from "react";
class CalendarComp extends Component {
  render() {
    return (
      <div className="card card-custom">
        <h6>Calendar</h6>
        <p>When you get paid and make payments.</p>
      </div>
    );
  }
}

export default CalendarComp;
